  "translationLines": [
    {
      "lineNumber": 133011,
      "originalJapaneseLine": "「ええい、洞窟内でキンキン騒ぐな」",
      "translatedEnglishLine": "\"Hey, don't make such a racket inside the cave.\""
    },
    {
      "lineNumber": 133012,
      "originalJapaneseLine": "「えーと、ここは確か……」",
      "translatedEnglishLine": "\"Um, if I recall correctly, this place is...\""
    },
    {
      "lineNumber": 133013,
      "originalJapaneseLine": "「おばーちゃん達がいる場所だよ」",
      "translatedEnglishLine": "\"The place where the grandmothers are.\""
    },
    {
      "lineNumber": 133014,
      "originalJapaneseLine": "「そーだそーだ、",
      "translatedEnglishLine": "\"That's right, that's right,\""
    },
    {
      "lineNumber": 133015,
      "originalJapaneseLine": "　カラー歴代の女王の霊が眠ってる場所だ」",
      "translatedEnglishLine": "  \"It's the place where the spirits of the past queens of Kala rest.\""
    },
    {
      "lineNumber": 133016,
      "originalJapaneseLine": "「ということは」",
      "translatedEnglishLine": "\"Which means...\""
    },
    {
      "lineNumber": 133017,
      "originalJapaneseLine": "聖地に入った途端、",
      "translatedEnglishLine": "The moment they entered the sacred ground,"
    },
    {
      "lineNumber": 133018,
      "originalJapaneseLine": "歴代の女王が姿を現した。",
      "translatedEnglishLine": "The past queens appeared before them."
    },
    {
      "lineNumber": 133019,
      "originalJapaneseLine": "先代の女王、モダン・カラー。",
      "translatedEnglishLine": "The previous queen, Modern Kala."
    },
    {
      "lineNumber": 133020,
      "originalJapaneseLine": "先々代女王、ビビッド・カラー。",
      "translatedEnglishLine": "The queen before her, Vivid Kala."
    },
    {
      "lineNumber": 133021,
      "originalJapaneseLine": "そして、先々々代女王、フル・カラー。",
      "translatedEnglishLine": "And the queen before that, Full Kala."
    },
    {
      "lineNumber": 133022,
      "originalJapaneseLine": "「遅い。なにしてた」",
      "translatedEnglishLine": "\"You're late. What were you doing?\""
    },
    {
      "lineNumber": 133023,
      "originalJapaneseLine": "「ひうっ！？ 」",
      "translatedEnglishLine": "\"Eek!?\""
    },
    {
      "lineNumber": 133024,
      "originalJapaneseLine": "突然怒られ、パステルは肩を竦めた。",
      "translatedEnglishLine": "Suddenly scolded, Pastel shrugged her shoulders."
    },
    {
      "lineNumber": 133025,
      "originalJapaneseLine": "「状況はある程度、知っています。",
      "translatedEnglishLine": "\"I understand the situation to some extent."
    },
    {
      "lineNumber": 133026,
      "originalJapaneseLine": "　外に魔軍が来て大変なことになってるのよね？」",
      "translatedEnglishLine": " The demon army has come outside and it's a big problem, right?\""
    },
    {
      "lineNumber": 133027,
      "originalJapaneseLine": "「は、はい、その通りですが……",
      "translatedEnglishLine": "\"Y-yes, that's right, but...\""
    },
    {
      "lineNumber": 133028,
      "originalJapaneseLine": "　その……遅いというのは……」",
      "translatedEnglishLine": " Well... about being late...\""
    },
    {
      "lineNumber": 133029,
      "originalJapaneseLine": "「こういう状況では村を捨てちゃっていいから。",
      "translatedEnglishLine": "\"In a situation like this, it's okay to abandon the village."
    },
    {
      "lineNumber": 133030,
      "originalJapaneseLine": "　ね？　いいわね、パステル？",
      "translatedEnglishLine": " Right? That's fine, Pastel?"
    },
    {
      "lineNumber": 133031,
      "originalJapaneseLine": "　始祖様だって皆だって怒ったりはしないから」",
      "translatedEnglishLine": " The founder and everyone won't get angry about it.\""
    },
    {
      "lineNumber": 133032,
      "originalJapaneseLine": "「正直、ひやひやした」",
      "translatedEnglishLine": "\"Honestly, I was really worried.\""
    },
    {
      "lineNumber": 133033,
      "originalJapaneseLine": "「がははは、俺だ俺、",
      "translatedEnglishLine": "\"Gahaha, it was me, me,"
    },
    {
      "lineNumber": 133034,
      "originalJapaneseLine": "　俺が村を捨てるよう説得したのだ」",
      "translatedEnglishLine": " I was the one who persuaded them to abandon the village.\""
    },
    {
      "lineNumber": 133035,
      "originalJapaneseLine": "「あ、あら、ありがとうございます、ランスさん。",
      "translatedEnglishLine": "\"Oh, thank you very much, Lance-san."
    },
    {
      "lineNumber": 133036,
      "originalJapaneseLine": "　パステルをそんなに気にかけて頂いて……」",
      "translatedEnglishLine": " For caring so much about Pastel...\""
    },
    {
      "lineNumber": 133037,
      "originalJapaneseLine": "「うむうむ、気にするな、モダンちゃん。",
      "translatedEnglishLine": "\"Hmm hmm, don't worry, Modern-chan."
    },
    {
      "lineNumber": 133038,
      "originalJapaneseLine": "　英雄として当然のことをしたまでだ」",
      "translatedEnglishLine": " I just did what was natural as a hero.\""
    },
    {
      "lineNumber": 133039,
      "originalJapaneseLine": "「さて、出るか……」",
      "translatedEnglishLine": "\"Well then, let's go...\""
    },
    {
      "lineNumber": 133040,
      "originalJapaneseLine": "一人、悠然とフルが歩き出す。",
      "translatedEnglishLine": "Alone, Full calmly started to walk forward."
    },
    {
      "lineNumber": 133041,
      "originalJapaneseLine": "それを見て、ビビッドが溜め息を漏らす。",
      "translatedEnglishLine": "Watching that, Vivid let out a sigh."
    },
    {
      "lineNumber": 133042,
      "originalJapaneseLine": "「……仕方ない。",
      "translatedEnglishLine": "\"...It can't be helped."
    },
    {
      "lineNumber": 133043,
      "originalJapaneseLine": "　パステル、神具を忘れぬように」",
      "translatedEnglishLine": " Pastel, don't forget the sacred artifact.\""
    },
    {
      "lineNumber": 133044,
      "originalJapaneseLine": "「さあ、行きましょうか」",
      "translatedEnglishLine": "\"Now then, shall we go?\""
    },
    {
      "lineNumber": 133045,
      "originalJapaneseLine": "「あ、ま、待って下さいー！」",
      "translatedEnglishLine": "\"W-w-wait, please!\""
    },
    {
      "lineNumber": 133046,
      "originalJapaneseLine": "「くうっ、妾、女王なのに……",
      "translatedEnglishLine": "\"Ugh, even though I'm a queen..."
    },
    {
      "lineNumber": 133047,
      "originalJapaneseLine": "　なんだか扱いが……うう……」",
      "translatedEnglishLine": " Somehow the way I'm treated is... ugh...\""
    },
    {
      "lineNumber": 133048,
      "originalJapaneseLine": "「今、戻ったぞー」",
      "translatedEnglishLine": "\"I'm back now!\""
    },
    {
      "lineNumber": 133049,
      "originalJapaneseLine": "「避難の用意は済んでないのか」",
      "translatedEnglishLine": "\"Isn't the evacuation preparation done yet?\""
    },
    {
      "lineNumber": 133050,
      "originalJapaneseLine": "「こ、これはビビッド様。申し訳ありません。",
      "translatedEnglishLine": "\"T-this is Vivid-sama. I apologize."
    },
    {
      "lineNumber": 133051,
      "originalJapaneseLine": "　なにせ、大所帯のものですから、",
      "translatedEnglishLine": " You see, since it's such a large group,"
    },
    {
      "lineNumber": 133052,
      "originalJapaneseLine": "　人を集めるだけで三十分ほどはかかります」",
      "translatedEnglishLine": " Gathering everyone takes about thirty minutes.\""
    },
    {
      "lineNumber": 133053,
      "originalJapaneseLine": "「サクラ、ペンシルカウの住人は",
      "translatedEnglishLine": "\"Sakura, how many residents are there in Pensilkau?"
    },
    {
      "lineNumber": 133054,
      "originalJapaneseLine": "　今、全員で何人ほど？」",
      "translatedEnglishLine": " How many are there in total now?\""
    },
    {
      "lineNumber": 133055,
      "originalJapaneseLine": "「2000人です」",
      "translatedEnglishLine": "\"There are 2,000 people.\""
    },
    {
      "lineNumber": 133056,
      "originalJapaneseLine": "「人数が増えれば敵に見つかる危険も増える。",
      "translatedEnglishLine": "\"The more people there are, the greater the risk of being spotted by the enemy."
    },
    {
      "lineNumber": 133057,
      "originalJapaneseLine": "　ふむ、大仕事になりそうだ」",
      "translatedEnglishLine": " Hm, this is going to be a big task.\""
    },
    {
      "lineNumber": 133058,
      "originalJapaneseLine": "「がははは！　安心しろ！",
      "translatedEnglishLine": "\"Gahahaha! Don't worry!"
    },
    {
      "lineNumber": 133059,
      "originalJapaneseLine": "　俺様はゼスの民族大移動も成功させた英雄だ！」",
      "translatedEnglishLine": " I am a hero who successfully led the great migration of the Zess tribe!\""
    },
    {
      "lineNumber": 133060,
      "originalJapaneseLine": "「まるで自分一人の偉業のように……」",
      "translatedEnglishLine": "\"As if it were a great achievement all mine alone...\""
    }
  ]
}

